import { Box, Container } from "@mui/material";
import React from "react";
import logoUdeA from "../assets/logos/logo.svg";

export const LayoutBox = () => {
  return (
    <Box
      xs={12}
      sm={8}
      md={5}
      sx={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        maxWidth:'100%',
        height:'auto'
      }}
    >
      <img src={logoUdeA} />
    </Box>
  );
};
